import { createTheme } from "@mui/material/styles";

export const theme = createTheme({
  components: {
    MuiCssBaseline: {
      styleOverrides: {
        ul: {
          listStyle: "none",
        },
      },
    },
    MuiSvgIcon: {
      styleOverrides: {
        root: { verticalAlign: "middle" },
      },
    },
  },
});
